void process(
    SampleValue ** inputs,
    Index numInputs,
    SampleValue ** outputs,
    Index numOutputs,
    Index n
) {
    this->vs = n;
    this->updateTime(this->getEngine()->getCurrentTime());
    SampleValue * target_Size = (numInputs >= 7 && inputs[6] ? inputs[6] : this->zeroBuffer);
    SampleValue * target_Diff = (numInputs >= 8 && inputs[7] ? inputs[7] : this->zeroBuffer);
    SampleValue * target_Decay = (numInputs >= 9 && inputs[8] ? inputs[8] : this->zeroBuffer);
    SampleValue * target_Jitter = (numInputs >= 10 && inputs[9] ? inputs[9] : this->zeroBuffer);
    SampleValue * target_Damp = (numInputs >= 11 && inputs[10] ? inputs[10] : this->zeroBuffer);
    SampleValue * out1 = (numOutputs >= 1 && outputs[0] ? outputs[0] : this->dummyBuffer);
    SampleValue * out2 = (numOutputs >= 2 && outputs[1] ? outputs[1] : this->dummyBuffer);
    SampleValue * in1 = (numInputs >= 1 && inputs[0] ? inputs[0] : this->zeroBuffer);
    SampleValue * in2 = (numInputs >= 2 && inputs[1] ? inputs[1] : this->zeroBuffer);
    SampleValue * in3 = (numInputs >= 3 && inputs[2] ? inputs[2] : this->zeroBuffer);
    SampleValue * in4 = (numInputs >= 4 && inputs[3] ? inputs[3] : this->zeroBuffer);
    SampleValue * in5 = (numInputs >= 5 && inputs[4] ? inputs[4] : this->zeroBuffer);
    SampleValue * in6 = (numInputs >= 6 && inputs[5] ? inputs[5] : this->zeroBuffer);
    this->line_09_perform(this->signals[0], n);
    this->line_10_perform(this->signals[1], n);
    this->line_11_perform(this->signals[2], n);
    this->signalsend_01_perform(this->signals[2], this->signals[3], n);
    this->line_12_perform(this->signals[2], n);
    this->signalsend_02_perform(this->signals[2], this->signals[4], n);
    this->line_13_perform(this->signals[2], n);
    this->signalsend_03_perform(this->signals[2], this->signals[5], n);
    this->line_14_perform(this->signals[2], n);
    this->signalsend_04_perform(this->signals[2], this->signals[6], n);
    this->line_15_perform(this->signals[2], n);
    this->signalsend_05_perform(this->signals[2], this->signals[7], n);

    this->p_15_perform(
        this->signals[3],
        this->signals[7],
        this->signals[5],
        this->signals[6],
        this->signals[4],
        in3,
        in4,
        this->signals[2],
        this->signals[8],
        n
    );

    this->signaladder_01_perform(in1, this->signals[2], this->signals[2], n);
    this->dspexpr_71_perform(this->signals[2], this->signals[1], this->signals[4], n);
    this->signaladder_02_perform(in2, this->signals[8], this->signals[8], n);
    this->dspexpr_72_perform(this->signals[8], this->signals[1], this->signals[6], n);
    this->p_13_perform(this->signals[4], this->signals[6], this->signals[1], this->signals[5], n);
    this->p_12_perform(this->signals[1], this->signals[5], this->signals[6], this->dummyBuffer, n);
    this->dspexpr_70_perform(this->signals[0], this->signals[6], this->signals[4], n);
    this->dspexpr_68_perform(in5, this->signals[4], this->signals[6], n);
    this->dspexpr_69_perform(in6, this->signals[4], this->signals[0], n);
    this->signaladder_03_perform(this->signals[6], this->signals[1], this->signals[1], n);
    this->signaladder_04_perform(this->signals[0], this->signals[5], this->signals[5], n);
    this->p_14_perform(this->signals[1], this->signals[5], out1, out2, n);
    this->stackprotect_perform(n);
    this->globaltransport_advance();
    this->audioProcessSampleCount += this->vs;
}

void prepareToProcess(number sampleRate, Index maxBlockSize, bool force) {
    if (this->maxvs < maxBlockSize || !this->didAllocateSignals) {
        Index i;

        for (i = 0; i < 9; i++) {
            this->signals[i] = resizeSignal(this->signals[i], this->maxvs, maxBlockSize);
        }

        this->globaltransport_tempo = resizeSignal(this->globaltransport_tempo, this->maxvs, maxBlockSize);
        this->globaltransport_state = resizeSignal(this->globaltransport_state, this->maxvs, maxBlockSize);
        this->zeroBuffer = resizeSignal(this->zeroBuffer, this->maxvs, maxBlockSize);
        this->dummyBuffer = resizeSignal(this->dummyBuffer, this->maxvs, maxBlockSize);
        this->didAllocateSignals = true;
    }

    const bool sampleRateChanged = sampleRate != this->sr;
    const bool maxvsChanged = maxBlockSize != this->maxvs;
    const bool forceDSPSetup = sampleRateChanged || maxvsChanged || force;

    if (sampleRateChanged || maxvsChanged) {
        this->vs = maxBlockSize;
        this->maxvs = maxBlockSize;
        this->sr = sampleRate;
        this->invsr = 1 / sampleRate;
    }

    this->globaltransport_dspsetup(forceDSPSetup);
    this->p_12->prepareToProcess(sampleRate, maxBlockSize, force);
    this->p_13->prepareToProcess(sampleRate, maxBlockSize, force);
    this->p_14->prepareToProcess(sampleRate, maxBlockSize, force);
    this->p_15->prepareToProcess(sampleRate, maxBlockSize, force);

    if (sampleRateChanged)
        this->onSampleRateChanged(sampleRate);
}

