void line_09_segments_set(const list& v) {
    this->line_09_segments = jsCreateListCopy(v);

    if ((bool)(v->length)) {
        SampleIndex currentTime = this->currentsampletime();
        number lastRampValue = this->line_09_currentValue;
        number rampEnd = currentTime - this->sampleOffsetIntoNextAudioBuffer;

        for (Index i = 0; i < this->line_09_activeRamps->length; i += 3) {
            rampEnd = this->line_09_activeRamps[(Index)(i + 2)];

            if (rampEnd > currentTime) {
                this->line_09_activeRamps[(Index)(i + 2)] = currentTime;
                number diff = rampEnd - currentTime;
                number valueDiff = diff * this->line_09_activeRamps[(Index)(i + 1)];
                lastRampValue = this->line_09_activeRamps[(Index)i] - valueDiff;
                this->line_09_activeRamps[(Index)i] = lastRampValue;
                this->line_09_activeRamps->length = i + 3;
                rampEnd = currentTime;
            } else {
                lastRampValue = this->line_09_activeRamps[(Index)i];
            }
        }

        if (rampEnd < currentTime) {
            this->line_09_activeRamps->push(lastRampValue);
            this->line_09_activeRamps->push(0);
            this->line_09_activeRamps->push(currentTime);
        }

        number lastRampEnd = currentTime;

        for (Index i = 0; i < v->length; i += 2) {
            number destinationValue = v[(Index)i];
            number inc = 0;
            number rampTimeInSamples;

            if (v->length > i + 1) {
                rampTimeInSamples = this->mstosamps(v[(Index)(i + 1)]);
            } else {
                rampTimeInSamples = this->mstosamps(this->line_09_time);
            }

            if (rampTimeInSamples <= 0)
                rampTimeInSamples = 1;

            inc = (destinationValue - lastRampValue) / rampTimeInSamples;
            lastRampEnd += rampTimeInSamples;
            this->line_09_activeRamps->push(destinationValue);
            this->line_09_activeRamps->push(inc);
            this->line_09_activeRamps->push(lastRampEnd);
            lastRampValue = destinationValue;
        }
    }
}

